import React from 'react'
import { useState, useEffect } from 'react'
import { Link } from 'react-router-dom'
import UpperWear1 from '../images/upperWear1.webp'
import UpperWear2 from '../images/upperWear2.webp'
import UpperWear3 from '../images/upperWear3.webp'
import UpperWear4 from '../images/upperWear4.webp'
import UpperWear5 from '../images/upperWear5.webp'
import UpperWear6 from '../images/upperWear6.webp'
import UpperWear7 from '../images/upperWear7.webp'

const UpperCategory = (props) => {
    // const { categoryId, sessionId } =  props
    // const [productsInCategory, setProductsInCategory] = useState([])
    // const [category, setCategory] = useState({})

    // useEffect(() => {
    //     fetch('http://localhost:8080/api/category/' + categoryId)
    //         .then(res => res.json())
    //         .then(res => {
    //             console.log(res)
    //             setCategory(res)
    //         })
    //         .catch(err => console.log(err))
    // }, [])


    // useEffect(() => {
    //     fetch('http://localhost:8080/api/showProducts/category/' + categoryId)
    //         .then(res => res.json())
    //         .then(res => {
    //             console.log(res)
    //             setProductsInCategory(res)
    //         })
    //         .catch(err => console.log(err))
    // }, [])


  return (
    // Show all products in this category with desctiption and price. the picture should be a link to the product page
    <div style={{ padding: '8%' }}>
        <h1  className='mb-4' style={{ fontWeight: 300 }}>Upperwear Category</h1>
        <div className="row">
            <div className="col-sm-4">
                <Link to="/product/1">
                    <img src={UpperWear1} alt="UpperWear1" style={{width: '100px', backgroundColor: '#E8E8E8', transition: 'transform 0.2s', }} onMouseOver={(e) => {
                            e.currentTarget.style.transform = 'scale(1.05)';
                        }}
                            onMouseOut={(e) => {
                                e.currentTarget.style.transform = 'scale(1)';
                            }}/>
                </Link>
                <p>Product Name</p>
                <p>Product Price</p>
            </div>
            <div className="col-sm-4">
                <Link to="/product/2">
                    <img src={UpperWear2} alt="UpperWear2" style={{width: '100px'}}/>
                </Link>
                <p>Product Name</p>
                <p>Product Price</p>
            </div>
            <div className="col-sm-4">
                <Link to="/product/3">
                    <img src={UpperWear3} alt="UpperWear3" style={{width: '100px'}}/>
                </Link>
                <p>Product Name</p>
                <p>Product Price</p>
            </div>
        </div>
        <div className="row">
            <div className="col-sm-4">
                <Link to="/product/4">
                    <img src={UpperWear4} alt="UpperWear4" style={{width: '100px'}}/>
                </Link>
                <p>Product Name</p>
                <p>Product Price</p>
            </div>
            <div className="col-sm-4">
                <Link to="/product/5">
                    <img src={UpperWear5} alt="UpperWear5" style={{width: '100px'}}/>
                </Link>
                <p>Product Name</p>
                <p>Product Price</p>
            </div>
            <div className="col-sm-4">
                <Link to="/product/6">
                    <img src={UpperWear6} alt="UpperWear6" style={{width: '100px'}}/>
                </Link>
                <p>Product Name</p>
                <p>Product Price</p>
            </div>
        </div>
        <div className="row">
            <div className="col-sm-4">
                <Link to="/product/7">
                    <img src={UpperWear7} alt="UpperWear7" style={{width: '100px'}}/>
                </Link>
                <p>Product Name</p>
                <p>Product Price</p>
            </div>
        </div>
    </div>
  )
}

export default UpperCategory
